use std::collections::HashMap;
use std::sync::{Arc, Mutex};
use std::thread;

#[derive(Debug)]
struct WordFrequency {
    word: String,
    frequency: i32,
}
impl WordFrequency {
    fn new(word: String, frequency: i32) -> WordFrequency {
        WordFrequency { word, frequency }
    }
}

fn main() {
    println!("starting");
    let words_map = Arc::new(Mutex::new(HashMap::new()));
    let array_of_words: Vec<&str> = DUMMY_TEXT.split(" ").collect();
    let number_of_words = array_of_words.len();
    let mut sum_of_word_lengths = 0;
    for word in array_of_words {
        let mut words_map = words_map.lock().unwrap();
        let mut entry = *words_map.entry(word).or_insert(0);
        entry += 1;
        sum_of_word_lengths += word.len();
    }
    let mut biggest = "";
    let word_map_clone_1 = Arc::clone(&words_map);
    let thread1 = thread::spawn(move || {
        let words_map = word_map_clone_1.lock().unwrap();
        for (key, _value) in &*words_map {
            if key.len() > biggest.len() {
                biggest = key;
            }
        }
    });

    let word_map_clone_2 = Arc::clone(&words_map);
    let most_common = Arc::new(Mutex::new(WordFrequency::new(String::from(""), 0)));
    let most_common_clone = Arc::clone(&most_common);
    let thread2 = thread::spawn(move || {
        let words_map = word_map_clone_2.lock().unwrap();
        let most_common = most_common_clone.lock().unwrap();
        for (key, value) in &*words_map {
            if value > &most_common.frequency {
                let mut dereferance_most_common = &*most_common;
                dereferance_most_common = &WordFrequency::new(key.to_string(), *value);
            }
        }
    });
    thread1.join().unwrap();
    thread2.join().unwrap();
    let average = sum_of_word_lengths as f32 / number_of_words as f32;
    let most_common = most_common.lock().unwrap();
    println!(
        "Biggest word is {:?}, average word length is {:?}, most common word is {:?}",
        biggest, biggest, most_common.word
    )
}

